import logo from './logo.svg';
import './App.css';
import Filter from './Component/Filter/index'
import TodoList from './Component/TodoList/index'
import { setupServe } from './Component/fakeapi';
import { useEffect } from 'react';

setupServe();
function App() {
  useEffect(()=>{
    fetch("/api/todos")
    .then(res=>res.json)
    .then()
  })
  return (
    <div className="App">
      <Filter/>
      <TodoList/>
    </div>
  );
}

export default App;
